import React from "react";
import "./Profile.css";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

import { useNavigate } from "react-router-dom";

const Account = () => {
  const navigate = useNavigate();

  const navigateToProfile = () => {
    navigate("/profile");
  };
  const navigateToMessages = () => {
    navigate("/meldinger");
  };
  const navigateToMyAnnonces = () => {
    navigate("/mine-annonser");
  };
  const navigateToFavorites = () => {
    navigate("/favoritter");
  };
  const navigateToCreateAnnonce = () => {
    navigate("/nyannonse");
  };

  return (
    <div className="profileLinks">
      <Row className="profilelink-row">
        <Col lg={6} className="profilelink-col">
          <a href='/profile'>
              <div className="profilelink-box" onClick={navigateToProfile}>
                <i className="fa-regular fa-user profilelink-box-icon"></i>
                <h3>Profil</h3>
                <p>Se din profil</p>
              </div>
          </a>
          <a href='/meldinger'>
              <div className="profilelink-box" >
                <i className="fa-regular fa-message profilelink-box-icon"></i>
                <h3>Meldinger</h3>
                <p>Se meldingene dine</p>
              </div>
          </a>
          <a href='/nyannonse'>
              <div className="profilelink-box" onClick={navigateToCreateAnnonce}>
                <i className="fa-regular fa-square-plus profilelink-box-icon"></i>
                <h3>Ny Annonse</h3>
                <p>Danne og publisere en ny annonse</p>
              </div>
          </a>
        </Col>
        <Col lg={6} className="profilelink-col">
            <a href='/favoritter'>
                <div className="profilelink-box">
                  <i className="fa-regular fa-heart profilelink-box-icon"></i>
                  <h3>Favoritter</h3>
                  <p>Se og endre dine favoritte annonser</p>
                </div>
          </a>

          <div className="profilelink-box" onClick={navigateToMyAnnonces}>
            <i className="fa-solid fa-receipt profilelink-box-icon"></i>
            <h3>Annonsene Mine</h3>
            <p>Se og endre annonsene dine</p>
          </div>
        </Col>
      </Row>
    </div>
  );
};

export default Account;
